import { Component, OnInit } from '@angular/core';
import { StagiaireService } from './stagiaire.service';
import { User } from './../shared/User';
import * as jsPDF from 'jspdf'
import {Router} from '@angular/router';

 declare interface TableData {
    headerRow: string[];
    dataRows: string[][];
}

@Component({
  selector: 'app-tables',
  templateUrl: './stagiaire.component.html',
  styleUrls: ['./stagiaire.component.css']
})
export class TablesComponent implements OnInit {

    public user : User;
    public tableData1: TableData;
    public tableData2: TableData;
    public tabStag: Array <any>;
    public nom : String;
    public contractTypeValid = "False";
    private page:number = 0;
    private pages:Array<any>;
    private i:number;
    public tabStag1: Array<any>;
    


  constructor(private  stagiaireService: StagiaireService,private router: Router) { }

  ngOnInit() {
    
    this.getSatgiairePage();
} 
setPage(i,event:any){
  this.i=i;
  event.preventDefault();
  this.page=i;
  this.getSatgiairePage();
} 
    
    
affiche() {
    this.stagiaireService.getAll().subscribe(data => {
        this.tabStag = data;

});
}

getSatgiairePage(){
  this.stagiaireService.getSatgiaire(this.page).subscribe(data =>{
    this.tabStag = data['content'];
    this.pages= new Array(data['totalPages']);
  });
}
ajouter(){
  this.stagiaireService.changeClick("ajouter");
  this.router.navigate(['/user']);

}

update(id){
  this.stagiaireService.getById(id).subscribe( (data:Array<any>)  => {
    this.tabStag1 = data;
    this.stagiaireService.changeMessage(this.tabStag1);
    this.stagiaireService.changeClick("modifier");

    this.router.navigate(['/user']);
    });
    
}

deleteStag(id){
  this.stagiaireService.deleteStag(id).subscribe((response => {console.log(response); this.stagiaireService.getAll().subscribe(data=>{this.tabStag = data;})

  }));
  this.getSatgiairePage();
  
  
}

Search(){
  if (this.nom != "") {
      this.tabStag = this.tabStag.filter(response => {return response.nom.toLocaleLowerCase().match(this.nom.toLocaleLowerCase());
      });

  }
  else if (this.nom == "" ){
      this.ngOnInit();
  }
}
getById(id : String){
  
  this.stagiaireService.getById(id).subscribe( (data:Array<any>)  => {
  this.tabStag1 = data;
  const doc = new jsPDF();
  var imgData='data:image/png;base64,';
  doc.addImage(imgData,15,15,50,50)
  doc.text("ATTESTATION DE STAGE",80,80);
  doc.setFont("helvetica");
  doc.setFontSize(9);
  doc.text("REF : ATS-2018-16",20,100);
  doc.text("Nous soussign la socit SPARK filiale de la socit SPARK IT France, immatricule au registre du commerce sous le numro ",20,105);
  doc.text("B08237182013 et sise l'avenue Habib Bourguiba Imm Skia centre App 21, 3011 Sfax, Tunisie. ",20,110);
  doc.text("Nous attestons par la prsente que Monsieur "+this.tabStag1['nom']+" "+this.tabStag1['prenom'],20,120);
  doc.save("firstPDF.pdf")
  
});

  

}

}
